import React from 'react';
import {Navbar, Sessions} from './styles'

function HomePage(){
  return(
    <>
      <Navbar>
        <Sessions>
          <button type="button" onClick="window.location.hrfe='www.google.com'" value="w3docs" >Início</button>
          <button type="button" onClick="www.google.com" >Dados</button>
          <button type="button" onClick="www.google.com" >Metodologia</button>
          <button type="button" onClick="www.google.com" >Contato</button>
        </Sessions>
      </Navbar>
    </>
  )

}

export default HomePage;
